import React from 'react'

function ListPlayers({players,}) {
  console.log(players)
  const listplayers = players.map( player =>
    <div>{player.player_name}</div>
  )
  return (
    <div className='contentContainer'>
      <div style={{width:'10rem'}}></div>
      <div>
        {listplayers}
      </div>
    </div>
  )
}

export default ListPlayers
